import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

let users=[
  {name:'moein',age:20,gen:"mel"},
  {name:'sadaf',age:21},
  {name:'sahar',age:22},
{},
{}]
let name=users[0]
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <App name={name}/>
);
